(65013, '9EE401CB-925C-4C98-BB38-C863618C1AD7', 'Hey love, I‚Äôm sorry for speaking harshly this morning to you by saying ‚Äúthis is why you are in court‚Äù in response to you sharing what happened with maya reading your text messages. I realize that is an unfair comparison and that it felt hurtful to you. Im grateful to you for your support for nathan. The fact that he reaches out to you for guidance and feedback in this tough situation is a testament to the trust you have built with him‚Ä¶.because he knows how much you care and love him.', 'David', 'Nitzan', '2023-01-30T09:40:36.581859'),
