(65023, 'CA8FDDBB-4F1D-4DEF-A8D4-E888F3871750', 'For what it‚Äôs worth, there‚Äôs not one CEO IÔ∏è have talked to in the last few months that hasn‚Äôt had a law suit. IÔ∏è wouldn‚Äôt say that there aren‚Äôt learnings for me ‚Äî there most certainly are. IÔ∏è know what IÔ∏è won‚Äôt do again for sure. But to fling that in my face just feels like you don‚Äôt really understand how crazy the environment is out there for law suits. Elizabeth had to pay 75k to someone last week. And it‚Äôs easy to judge. ', 'Nitzan', 'David', '2023-01-30T09:59:49.775281'),
(65026, '835446EE-4377-4BB3-A8B6-C4681ED01113', 'I understand that your lawsuit is totally crazy and unwarranted and is an example of toxic culture + easy loopholes for people to abuse in the legal system. I don‚Äôt envy any public leader pushing for change ‚Ä¶ because everyone is now a target‚Ä¶.which makes it even more important to be very careful what one says, to whom, and in what forum. We clearly have different approaches and opinions on what this looks like in practice. And yes, even when one does everything ‚Äúright‚Äù  there is a risk of ‚Äúno good deed goes unpunished.‚Äù  I honor your courage and the work you do every day. It is incredibly difficult.', 'David', 'Nitzan', '2023-01-30T10:44:48.163000'),
