(65084, 'CD88BDB5-8770-4CC4-83E5-0E7112FFAAEA', 'Love, as I head out on my date, I want to offer an amended apology. I‚Äôm sorry for being reactive and judgemental in how I spoke to you by saying that not being careful with your words is why you are going to court. I know that this hurt you and that every time I speak this way, it makes it more difficult for you to feel safe and open to difficult, vulnerable conversations. I will continue my work to be more aware and present and less reactive in the moment.  I also want to repeat again what I said this afternoon‚Ä¶.maybe slightly differently. I am in love with your gigantic, giving heart, which is an inspiration to me every day. You give tirelessly to others to help them improve their lives and to me so that we can build a loving vibrant and, yes, sometimes challenging life together. I feel the deepest of gratitude to you for making such a rich life possible. I feel blessed every day to have the gift of you as my partner‚Ä¶.even (maybe especially) the days/nights apart. It felt so good to wrap myself around you last night, and welcome you home. I appreciate the gift of a little play time tonight, and the enormous gift‚Ä¶.to come home to reconnect with you.  I love you so very much‚Ä¶you are the most precious gift of all. But a small gift awaits when you come home‚Ä¶a tree with a few special leaves for you (it‚Äôs almost tubishvat??) that we can add to over the month‚Ä¶ Love you so very much!', 'David', 'Nitzan', '2023-01-30T17:30:51.947359'),
